import React, { Component } from 'react'
import '../style.css'
class Header extends Component {
    render() {
        return (
            <div className="navbar navbar-dark bg-dark">
             <h2 className="text-white text-center">Our Team</h2>
            </div>
        )
    }
}

export default Header
